export const increment = () => {
    return {
        type: 'INCREMENT'
    };
};

export const decrement = () => {
    return {
        type: 'DECREMENT'
    };
};

export const incrementByFive = () => {
    return {
        type: 'INCREMENTBY5',
        payload: 5
    };
};
